import React,{useEffect} from 'react';

import { Link, useHistory } from 'react-router-dom';
import Header from './Header'

const Home = () =>{
    return (
        <>
           <header>
            <Header/>
           </header>
           <body>
               <center>
                    <h1> Home Page </h1>
               </center>
           </body>
        </>
    );
}

export default Home;
